import { useState } from "react"
import React from 'react'
function State(){
    const [text,setText] = useState("") 
    function changehandle(e){
        setText(e.target.value)
    }
    return(
        <div>
            <input type="text"  value = {text}onChange={changehandle}></input>
        </div>
    )
}
export default State
